shapes.frame_eqs_eel:
sample=instance/num_inst;

///// Sphere
r1=1;
q10= -1+2*sample;
q11=200*sample;

my_x = sqrt(r1*r1-q10*q10)*cos(q11);
my_y = sqrt(r1*r1-q10*q10)*sin(q11);
my_z = q10+3*sin(2*q1+time)*sin(.5*sample)*my_x*my_y;


///// drago
t1 = 10*sample+time*.1;
x1 = .5*(.6*sin (7*t1)+.4*sin (4.3*t1)) ;
y1 = .5*(.6*cos (3.3*t1)+.4*cos (6.9*t1))* sin (-100+200*sample) ;
z1 = .5*(.6*cos (4.1*t1)+.4*cos (6.9*t1)) * cos (-50+100*sample) ;


my_x = if(above(sample,.45)*below(sample,.55),x1,my_x);
my_y = if(above(sample,.45)*below(sample,.55),y1,my_y);
my_z = if(above(sample,.45)*below(sample,.55),z1,my_z);


/////// rotations... by flexi

d = 2; 
zoom = 1;

w3 = .6*sin(q1);
w2 = .6*sin(q3);
w1 = q2;

x1 = cos(w1)*my_x + sin(w1)*my_y;
y1 = -sin(w1)*my_x + cos(w1)*my_y;
z1 = my_z;

x2 = cos(w2)*x1 + sin(w2)*z1;
z2 = -sin(w2)*x1 + cos(w2)*z1;
y2 = y1;

y3 = cos(w3)*y2 + sin(w3)*z2;
z3 = -sin(w3)*y2 + cos(w3)*z2;
x3 = x2;

// perspective calculation

l = sqrt(x3*x3 + y3*y3);
w = atan2(x3,y3);
p = tan(asin(1) + atan2(d+z3,l));
d = sqrt(x3*x3 + y3*y3 + (z3+d)*(z3+d));

my_x = zoom*sin(w)*p;
my_y = zoom*cos(w)*p;

x = 0.5 + my_x/q6;
y = 0.5 + my_y/q5;


////////// sphere
rad=rad/d;
b=sin(3.14*sample+.3*time);
r=.9*b;
g=.9*b;
b2=.9*b;
r2=.9*b2;
g2=.9*b2;
border_r=r;
border_g=g;
border_b=b;


////// drago

rad= if(above(sample,.45)*below(sample,.55), .02*rad+12*rad*(sample-.45), rad);
ang= if(above(sample,.45)*below(sample,.55), 300*(sample-.55)*time,0);
sides= if(above(sample,.45)*below(sample,.55), 14*(1-10*(sample-.45)),20);

r= if(above(sample,.45)*below(sample,.55),sample,r);
g= if(above(sample,.45)*below(sample,.55),sample,g);
b= if(above(sample,.45)*below(sample,.55),sample,b);
r2= if(above(sample,.45)*below(sample,.55),.1,r2);
g2= if(above(sample,.45)*below(sample,.55),.1,g2);
b2= if(above(sample,.45)*below(sample,.55),.1,b2);

a2= if(above(sample,.45)*below(sample,.55),.6,a2);
border_a= if(above(sample,.45)*below(sample,.55),0,.5);

sample=instance/num_inst;

////// dna

s1=30*sample;   s2=s1%30;
x=.5+s2-s1;     y=0;

t=.21*s2;
mx=x*sin(t)+y*cos(t);
my=y*sin(t)-x*cos(t);
mz=-2.9+.2*s2;

my_x = 1.3*mx;
my_y = 1.3*my;
my_z = mz;


rad=rad*(1+3*bnot(instance%20)+3*bnot((instance-1)%20));

//// rotations

d = 7; 
zoom =1.5;

w1 = .5*time;
w2 = 0;
w3 = 1.57;

x1 = cos(w1)*my_x + sin(w1)*my_y;
y1 = -sin(w1)*my_x + cos(w1)*my_y;
z1 = my_z;

x2 = cos(w2)*x1 + sin(w2)*z1;
z2 = -sin(w2)*x1 + cos(w2)*z1;
y2 = y1;

y3 = cos(w3)*y2 + sin(w3)*z2;
z3 = -sin(w3)*y2 + cos(w3)*z2;
x3 = x2;

l = sqrt(x3*x3 + y3*y3);
w = atan2(x3,y3);
d = sqrt(x3*x3 + y3*y3 + (z3+d)*(z3+d));
p = tan(asin(1) + atan2(d+z3,l));

my_x = zoom*sin(w)*p;
my_y = zoom*cos(w)*p;

x = 0.5 + my_x/q6;
y = 0.5 + my_y;


rad=rad*zoom/d;

